The '''undead attribute''' provides weaknesses to the [[salve amulet]] and the [[Crumble Undead]] spell.

==Effects==
*The [[salve amulet]] will provide the player with a 16.67% boost to [[Attack]] and [[Strength]]. The [[salve amulet(i)|imbued]] version will additionally provide a 16.67% boost to [[Ranged]] and a 15% boost to [[Magic]]. This does not stack with the [[Slayer helmet]].
*The [[salve amulet (e)]] will provide the player with a 20% boost to [[Attack]] and [[Strength]]. The [[salve amulet(ei)|imbued]] version will additionally provide a 20% boost to [[Ranged]] and [[Magic]]. This does not stack with the [[Slayer helmet]].
*The [[Crumble Undead]] spell may only be used against monsters with the undead attribute. Requiring level 39 [[Magic]], it has a max hit of 15 and only costs 1 [[chaos rune]] and some elemental runes.

