==Excluded monsters==
Despite appearing to be ghosts, the [[Barrows brothers]] do not have the undead attribute. Additionally, monsters in the [[Nightmare Zone]] are not considered undead.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/895337821103284224|date=9 August 2017|archiveurl=https://archive.is/FRjGA|archivedate=26 April 2020|quote=I don't see any in the list that look like they'd be classed as undead.}}

